@namespace url(http://www.mozilla.org/keymaster/gatekeeper/there.is.only.xul);
/* ==UserStyle==
// @name         Firefox 1 toolbar buttons.
// @author       Roblesolido
// @compatible   Firefox 3
// @description	 Changes the toolbar with the icons of the Firefox 1 theme.
// ==/UserStyle==*/

/* ----- Dropmarker ----- */
#back-forward-dropmarker{padding:3px !important; list-style-image:url(chrome://global/skin/arrow/arrow-dn.gif) !important; -moz-image-region: auto !important;}
#back-forward-dropmarker[disabled="true"]{list-style-image:url(chrome://global/skin/arrow/arrow-dn-dis.gif) !important; -moz-image-region: auto !important;}

/* ----- Buttons ----- */
#back-button .toolbarbutton-icon{-moz-image-region:rect(0px 24px 24px 0px) !important}
#back-button[buttonover="true"] .toolbarbutton-icon,
#back-button[open="true"] .toolbarbutton-icon {-moz-image-region:rect(24px 24px 48px 0px) !important}
#back-button[disabled="true"] .toolbarbutton-icon {-moz-image-region:rect(48px 24px 72px 0px) !important}

#forward-button .toolbarbutton-icon{-moz-image-region:rect(0px 48px 24px 24px) !important}
#forward-button[buttonover="true"] .toolbarbutton-icon,
#forward-button[open="true"] .toolbarbutton-icon {-moz-image-region:rect(24px 48px 48px 24px) !important}
#forward-button[disabled="true"] .toolbarbutton-icon{-moz-image-region:rect(48px 48px 72px 24px) !important}

#stop-button .toolbarbutton-icon{-moz-image-region:rect(0px 72px 24px 48px) !important}
#stop-button:hover .toolbarbutton-icon{-moz-image-region:rect(24px 72px 48px 48px) !important}
#stop-button[disabled="true"] .toolbarbutton-icon{-moz-image-region:rect(48px 72px 72px 48px) !important}

#reload-button .toolbarbutton-icon{-moz-image-region:rect(0px 96px 24px 72px) !important}
#reload-button:hover .toolbarbutton-icon{-moz-image-region:rect(24px 96px 48px 72px) !important}
#reload-button[disabled="true"] .toolbarbutton-icon{-moz-image-region:rect(48px 96px 72px 72px) !important}

#home-button .toolbarbutton-icon{-moz-image-region:rect(0px 120px 24px 96px) !important}
#home-button:hover .toolbarbutton-icon{-moz-image-region:rect(24px 120px 48px 96px) !important}

#downloads-button .toolbarbutton-icon{-moz-image-region:rect(0px 144px 24px 120px) !important}
#downloads-button:hover .toolbarbutton-icon{-moz-image-region:rect(24px 144px 48px 120px) !important}
#downloads-button[disabled="true"] .toolbarbutton-icon{-moz-image-region:rect(48px 144px 72px 120px) !important}

#history-button .toolbarbutton-icon{-moz-image-region:rect(0px 168px 24px 144px) !important}
#history-button:hover .toolbarbutton-icon{-moz-image-region:rect(24px 168px 48px 144px) !important}
#history-button[disabled="true"] .toolbarbutton-icon{-moz-image-region:rect(48px 168px 72px 144px) !important}
#history-button[checked="true"] .toolbarbutton-icon{-moz-image-region:rect(24px 168px 48px 144px) !important}

#bookmarks-button .toolbarbutton-icon{-moz-image-region:rect(0px 192px 24px 168px) !important}
#bookmarks-button:hover .toolbarbutton-icon,
#bookmarks-button[checked="true"] .toolbarbutton-icon{-moz-image-region:rect(24px 192px 48px 168px) !important}
#bookmarks-button[disabled="true"] .toolbarbutton-icon{-moz-image-region:rect(48px 192px 72px 168px) !important}

#print-button .toolbarbutton-icon{-moz-image-region:rect(0px 216px 24px 192px) !important}
#print-button:hover .toolbarbutton-icon{-moz-image-region:rect(24px 216px 48px 192px) !important}
#print-button[disabled="true"] .toolbarbutton-icon{-moz-image-region:rect(48px 216px 72px 192px) !important}

#new-tab-button .toolbarbutton-icon{-moz-image-region:rect(0px 240px 24px 216px) !important}
#new-tab-button:hover .toolbarbutton-icon{-moz-image-region:rect(24px 240px 48px 216px) !important}
#new-tab-button[disabled="true"] .toolbarbutton-icon{-moz-image-region:rect(48px 240px 72px 216px) !important}

#new-window-button .toolbarbutton-icon{-moz-image-region:rect(0px 264px 24px 240px) !important}
#new-window-button:hover .toolbarbutton-icon{-moz-image-region:rect(24px 264px 48px 240px) !important}
#new-window-button[disabled="true"] .toolbarbutton-icon{-moz-image-region:rect(48px 264px 72px 240px) !important}

#cut-button .toolbarbutton-icon{-moz-image-region:rect(0px 288px 24px 264px) !important}
#cut-button:hover .toolbarbutton-icon{-moz-image-region:rect(24px 288px 48px 264px) !important}
#cut-button[disabled="true"] .toolbarbutton-icon{-moz-image-region:rect(48px 288px 72px 264px) !important}

#copy-button .toolbarbutton-icon{-moz-image-region:rect(0px 312px 24px 288px) !important}
#copy-button:hover .toolbarbutton-icon{-moz-image-region:rect(24px 312px 48px 288px) !important}
#copy-button[disabled="true"] .toolbarbutton-icon{-moz-image-region:rect(48px 312px 72px 288px) !important}

#paste-button .toolbarbutton-icon{-moz-image-region:rect(0px 336px 24px 312px) !important}
#paste-button:hover .toolbarbutton-icon{-moz-image-region:rect(24px 336px 48px 312px) !important}
#paste-button[disabled="true"] .toolbarbutton-icon{-moz-image-region:rect(48px 336px 72px 312px) !important}

/* ----- small size ----- */
toolbar[iconsize="small"] #back-button .toolbarbutton-icon,
toolbar[iconsize="small"] #forward-button .toolbarbutton-icon,
toolbar[iconsize="small"] #stop-button .toolbarbutton-icon,
toolbar[iconsize="small"] #reload-button .toolbarbutton-icon,
toolbar[iconsize="small"] #home-button .toolbarbutton-icon,
toolbar[iconsize="small"] #downloads-button .toolbarbutton-icon,
toolbar[iconsize="small"] #history-button .toolbarbutton-icon,
toolbar[iconsize="small"] #bookmarks-button .toolbarbutton-icon,
toolbar[iconsize="small"] #print-button .toolbarbutton-icon,
toolbar[iconsize="small"] #new-tab-button .toolbarbutton-icon,
toolbar[iconsize="small"] #new-window-button .toolbarbutton-icon,
toolbar[iconsize="small"] #cut-button .toolbarbutton-icon,
toolbar[iconsize="small"] #copy-button .toolbarbutton-icon,
toolbar[iconsize="small"] #paste-button .toolbarbutton-icon,
toolbar[iconsize="small"] #mail-button .toolbarbutton-icon
{
width:17px !important;
height:17px !important;
}

/* ----- Image ----- */
#back-button,
#forward-button,
#stop-button,
#reload-button,
#home-button,
#downloads-button,
#history-button,
#bookmarks-button,
#print-button,
#new-tab-button,
#new-window-button,
#cut-button,
#copy-button,
#paste-button,
#mail-button
{
-moz-appearance: toolbarbutton !important;
list-style-image: url(data:image/png;base64,) !important;
}

/* ----- End ----- */
